import {useSelector} from 'react-redux';

export const TodoList=()=>{
    const {todos}=useSelector((state)=>state);

    return (
        <div>
            {todos.map((todo)=>(
                <p key={todo.id}>{todo.title}{'-->'}{todo.status?"Complete":"Incomplete"}</p>
            ))}
        </div>
    )

}
